#Need to find the number of rolls @ that are accessible. Only accessable if there are fewer than four rolls of paper in the eight adjacent positions. https://adventofcode.com/2025/day/4

def count_accessible_rolls(grid_str):
    """Count rolls of paper accessible by forklifts."""
    # Convert the string to a 2D grid
    grid = [list(line.strip()) for line in grid_str.strip().split('\n')]
    
    rows = len(grid)
    cols = len(grid[0])
    
    # Define the 8 possible directions (including diagonals)
    directions = [
        (-1, -1), (-1, 0), (-1, 1),  # Above row
        (0, -1),           (0, 1),   # Same row
        (1, -1),  (1, 0),  (1, 1)    # Below row
    ]
    
    accessible_count = 0
    
    # Iterate through each cell in the grid
    for i in range(rows):
        for j in range(cols):
            # Only check positions with paper rolls
            if grid[i][j] == '@':
                neighbor_count = 0
                
                # Check all 8 neighbors
                for dx, dy in directions:
                    ni, nj = i + dx, j + dy
                    
                    # Check if neighbor is within grid bounds
                    if 0 <= ni < rows and 0 <= nj < cols:
                        if grid[ni][nj] == '@':
                            neighbor_count += 1
                
                # If fewer than 4 neighbors are '@', it's accessible
                if neighbor_count < 4:
                    accessible_count += 1
    
    return accessible_count

